const ActivityCommentSection = () => {
  return (
  <section>
    <CommentInputWrap>
        <CommentInput />
        <CommentWriteBtn>댓글달기</CommentWriteBtn>
    </CommentInputWrap>
    <CommentListWrap>
        <CommentItem>
            <CommentHeader>
                작성자 id : aa@naver.com
                </CommentHeader>
            <CommentDate>작서일: 2023-01-01</CommentDate>
        </CommentItem>
    </CommentListWrap>
    </section>
    );
};

export default ActivityCommentSection;
